import React from 'react';
import { YMaps, Map } from 'react-yandex-maps';

const Google = () => {
  return (
    <YMaps>
      <div>
        <Map defaultState={{ center: [55.751244, 37.618423], zoom: 10 }} style={{ width: '100%', height: '400px' }} />
      </div>
    </YMaps>
  );
};

export default Google;
